import s from "./style.module.css";

const TeamCard: React.FC = () => {
  return (
    <div className={s.team}>
      <div className={s.team__logo}></div>
      <div className={s.team__info}>
        <div className={s.team__name}>Portland trail blazers</div>
        <div className={s.team__foundation}>Year of foundation: 1970</div>
      </div>
    </div>
  );
};

export default TeamCard;
